import React from 'react';
import { BrowserRouter, Routes, Route, Navigate } from 'react-router-dom';
import Header from './Components/Header';
import Index from './Components/Index';
import About from './Components/About';
import Section from './Components/Services';
import Pricing from './Components/Pricing';
import Stats from './Components/Stats';
import Contact from './Components/Contact';
import Portfolio from './Components/Portfolio';
import AddToCart from './Components/AddToCart';
// import Signup from './Components/Signup'; // Remove Signup component if not needed
// import Login from './Components/Login'; // Remove Login component if not needed

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Navigate to="/login" />} />
        {/* Remove or comment out the signup and login routes if not needed */}
        {/* <Route path="/signup" element={<Signup />} />
        <Route path="/login" element={<Login />} /> */}
        <Route
          path="/dashboard"
          element={
            <>
              <Header />
              <Index />
            </>
          }
        />
        <Route
          path="/about"
          element={
            <>
              <Header />
              <About />
            </>
          }
        />
        <Route
          path="/section"
          element={
            <>
              <Header />
              <Section />
            </>
          }
        />
        <Route
          path="/portfolio"
          element={
            <>
              <Header />
              <Portfolio />
            </>
          }
        />
        <Route
          path="/stats"
          element={
            <>
              <Header />
              <Stats />
            </>
          }
        />
        <Route
          path="/pricing"
          element={
            <>
              <Header />
              <Pricing />
            </>
          }
        />
        <Route
          path="/contact"
          element={
            <>
              <Header />
              <Contact />
            </>
          }
        />
        <Route
          path="/addToCart"
          element={
            <>
              <Header />
              <AddToCart />
            </>
          }
        />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
